import React from "react";
import TransactionForm from ".././Form";
import Transaction from ".././Transaction";
import View from ".././View";
import Login from ".././Login";
import { useEffect } from "react";
import { BrowserRouter, Route, Routes, useNavigate } from "react-router-dom";


const Auth = () => {
  const token = localStorage.getItem("logindata")["token"];
  const navigate = useNavigate();
  console.log(token);
  return (
    <>
      {
        <BrowserRouter>
          <Routes>
            <Route path="/create" element={<TransactionForm />} />
            <Route path="/create/:id" element={<TransactionForm />} />
            <Route path="/transaction" element={<Transaction />} />
            <Route path="/transaction/:id" element={<View />} />
            <Route path="*" element={<Login />} replace />
          </Routes>
        </BrowserRouter>
      }
    </>
  );
};

export default Auth;
